function Date({time}){
    let [date, tmp] = time.split('T');
    console.log(date);
    let [hour, min] = tmp.split(':');
    console.log(hour, min);

    return(
        <span>
            `${date} ${hour}:${min}`
        </span>
    );

}
export default Date;
